import React from 'react';

import { Container, Title, ContainerPhoto, PerfilPhoto } from './styles';

import perfilPhoto from './img/perfil.png';

function Home() {

    return (
        <Container>
            <Title>Bryn Diniz</Title>

            <ContainerPhoto>
                <Title>FRONTEND</Title>
                <PerfilPhoto src={perfilPhoto} />
                <Title>BACKEND</Title>
            </ContainerPhoto>


        </Container>
    );
}

export default Home;
